import { useContext } from "react";
import { GuildContext } from "../utils/contexts/GuildContext";
import { AppBarStyle } from "../utils/styles";
export const AppBar = () => {
  const { guildId } = useContext(GuildContext); 
  return (
    <AppBarStyle>
      <p style={{
        fontSize: '20px'

      }}>Configuring</p>
      <img
       src='https://cdn.discordapp.com/icons/947715289104150599/fcbc3da59538aed4b71d712cdfaac4c5.webp?size=128'
      height={60} width={60}
      style={{

          borderRadius: '50%'

      }}
      alt='logo'/>
    </AppBarStyle>
  );
};
